import React from "react";
class Header extends React.Component{
    render()
    {
        return (
            <div>
                <div id="hleft">Shopping Site Dummy</div>
                <div id="hright">Cart: {this.state.qty}</div>
            </div>
        );
    }
}
export default Header;
